import './Register.css'

function Register() {
  return (
    <div class="register">
        <div class="id">
          <input type="text" placeholder="아이디를 입력해주세요" class="input_id"/><button type="button" class="btn_check">중복체크</button>
        </div>

        <div class="pwd">
          <input type="password" placeholder="비밀번호 입력" class="input_pwd1"/><br/>
          <input type="password" placeholder="비밀번호 재입력" class="input_pwd2"/>
          <span class="span_pwd"></span>
        </div>

        <div class="nickname">
          <input type="text" placeholder="닉네임을 입력해주세요(2~12글자)" class="input_nick"/>
        </div>

    </div>
  );
}

export default Register;
